    @Test
    public void testSimpleArithmetics() {
        try {
            Assert.assertEquals(10d, CalculationEngineFactory.defaultEngine().calculate("5+5"));
            Assert.assertEquals(20d, CalculationEngineFactory.defaultEngine().calculate("10+10"));
            Assert.assertEquals(1e-1d + 1e-2d, CalculationEngineFactory.defaultEngine().calculate("1E-1 + 1E-2"));
            Assert.assertEquals(1.0d - 2.3d + 1.2d + 1.3412E2d, CalculationEngineFactory.defaultEngine().calculate("1.0 - 2.3 + 1.2 + 1.3412E2"));
            Assert.assertEquals(2d * 3d / 2d * 5d, CalculationEngineFactory.defaultEngine().calculate("2 * 3 / 2 * 5"));
            Assert.assertEquals(1d + 2d * 3d - 5d / 2d, CalculationEngineFactory.defaultEngine().calculate("1 + 2 * 3 - 5 / 2"));
            Assert.assertEquals(1d + -12d, CalculationEngineFactory.defaultEngine().calculate("1 + -12"));
        } catch (CalculationException e) {
            Assert.fail("Exception happened " + e);
        }
    }

